ig.baked=true;ig.module('game.briefs').defines(function(){oBriefs={"1_1":"Your mission is to kill every fucking enemy that stands in your way.>20< We are not sure how is behind this attack, its your job to find it out. (Mission: You must to find out who is behind this terrorist attack)>30< Dont get killed!","1_2":"    Our Tech-Team has          recovered the Toasty      Machine from one of The Boss's \n             warehouses: \n     Use it against your enemies! \n    (After this mission you may \n   upgrade Toasty in the store)","1_3":"    Our Tech-Team has          recovered the Frosty      Machine from one of The Boss's \n             warehouses: \n     Use it against your enemies! \n    (After this mission you may \n   upgrade Frosty in the store)","1_4":"  Ernesto, one of The Boss Army's generals, might know where The Boss is hidding. Let's \n       find him and 'ask nicely'. \n \n    (He knows where are all the \n             skeletons...)","1_5":"There's a huge army of men and drones in the city. We need to find out why are they gathered there, and what              are their intentions.","1_6":"  Intelligence-Team has        info about an alliance \n between the The Boss Army and a new terrorist cell: Pull the trigger! \n      (Terrorists are human-bombs. \n Don't let them approaches to you: \n          Aim to the head!)","1_7":"Ernesto is one of the top   generals of The Boss Army. \n We need all the information he \n               can give us.","1_8":" Before we took Ernesto \n  down, he gave us a list of \n   The Boss Army's top generals: \n    Anna Suzuki is one of them! \n \n       Let's shake some trees \n        and put her to rest.","1_9":"  Anna Suzuki's men are \n coming for you, we need to \n    kill them all and finish the \n   The Boss japanese terrorist cell. \n \n    (The best way to kill a ninja \n         is to use the knife)","1_10":"We know the whereabouts \n   of The Boss Army's japanese \n  cell. We need to find and kill them all. Their boss is a massive killer called Anna Suzuki, one of the \n    top generals of The Boss Army.","1_11":"\n Anna Suzuki is one of The Boss \n Army's top generals. We need \n to stop her and get some useful \n       information to accomplish \n            our vengeance!","1_12":" \n  Your mission is to find Fidel, who is another general of the The Boss Army, and make him to tell you where The Boss is, once it for all.","1_13":"  Fidel's army is moving \n forward. We need to stop it \n     to weak The Boss's power. \n \n (We have information about some \n   mistery machines flying in the \n          area, be careful)","1_14":" The terrorists are running \n  away but we need them all \n       dead! Take them out. \n \n     (Be careful: Our sources have \n information about a new powerful \n           flying weapon)","1_15":"\n   Fidel is flying the mistery \n machine. We need to destroy it \n     but Fidel must live because \n Intelligence-Team may use what he \n   knows about this technology.","1_16":" \n \n The Boss Army is in full retreat. \n \n   (Great time to test our armours)","1_17":"   We wiped out half of \n   The Boss's forces but their \n  japanese allies are still here. \n        Find and kill them all. \n \n           (Have no mercy!)","1_18":"\n \n   Its a full scale stampede of \n  cowards. Let's kick their butts. \n \n          We're almost there.","1_19":"\n \n    Fidel is waiting to kill you. \n \n      Let's kick his fat cuban ass!","bonus_1":"          Kill Bonus:>10< \n \n You'll have to kill every single \n enemy that appears, keep an eye \n            on the countdown.","bonus_2":"       Survival Bonus:>10< \n \n Your job is simple:>3< Stay alive \n        until the clock hits 0''.>10< \n      In the meantime try to score \n            some headshots! ","bonus_3":"         Ninja Bonus:>10< \n \n    Ninjas are a bit tricky: They \n    appear from nowhere and are \n              very hard to kill. \n   Keep moving, don`t stand still.","bonus_4":"          Ernesto Bonus:>10< \n \n            He has no guns, \n   but he will kick you very hard!","bonus_5":"     Anna Suzuki Bonus:>10< \n \n     No ninja stuff, just guns.","bonus_6":"  Mistery Machine Bonus:>10< \n \n  The terror come from the sky. \n       Open your 'parashooting'!",};});

